var digits_default = async (server2) => {
  const net = import_neural.FeedForwardNeuralNetwork.fromData(neural_digits_brain_default);
  server2.post("/neural/digits/predict", async (req, res) => {
    try {
      if (!req.body)
        throw new Error("No content provided");
      const data = req.body;
      if (typeof data != "object" || !data?.length || data.length != 784)
        throw new Error("Invalid content");
      const prediction = net.feedForward(data);
      res.type("application/json").send(prediction);
    } catch (e) {
      res.code(404).send(e.message);
    }
  });
  server2.get("/neural/digits/model", async (req, res) => {
    try {
      await useAuthenticated(req);
      return res.type("application/json").send(neural_digits_brain_default);
    } catch (e) {
      res.status(401).send(
        "Unauthorized. Submit a contact form to gain access to downloading models (This was done to prevent spam and save costs)"
      );
    }
  });
};

